import {TestBed} from '@angular/core/testing';
import {ArchiveService} from './archive.service';
import {ArchivedNewsletter} from "./archived-newsletter";
import {EnvServiceProvider} from "./env.service.provider";
import {HttpClientModule} from "@angular/common/http";

const baseArticleType: ArchivedNewsletter = {
  "abstract": "Something about taxes and representation",
  "author": "Thomas Jefferson",
  "img": "data:image/jpeg;base64,",
  "title": "Federalist Papers"
};

describe('ArchiveService', () => {
  let service: ArchiveService;

  beforeEach(() => {
    TestBed.configureTestingModule({
      imports: [HttpClientModule],
      providers: [EnvServiceProvider, ArchiveService]
    });
    service = TestBed.inject(ArchiveService);
  });

  it('should be created', () => {
    expect(service).toBeTruthy();
  });

  it('#uploadArchiveEntry should return the successfully uploaded archive', (done: DoneFn) => {
    service.uploadArchivedEntry(baseArticleType).subscribe(value => {
      console.log(value);
      expect(value).toEqual(jasmine.objectContaining({title: baseArticleType.title}));
      expect(value).toEqual(jasmine.objectContaining({abstract: baseArticleType.abstract}));
      expect(value).toEqual(jasmine.objectContaining({author: baseArticleType.author}));
      //TODO check for the new value of img, id and addedts
      done();
    })
  })
});
